import React from "react";
import Gondola from "./Gondola";

import 'Store.css'
var logoImage = require('../imgs/LIVINGPOG.png')

const Store = (props) => {
    console.log("gondolas = ",props.gondolas)
    return (
        <div>
            <img  
            className="logo_img" 
            src={logoImage} 
            alt = 'LogoImg'
            // style={productImageStyle}
        />
            {props.gondolas && props.gondolas.map((gondola,index) => (
                <Gondola
                    key={index}
                    gondola={gondola}
                    gondolaID={index+1}
                />
            ))}

        </div>

    );
};
export default Store;
